Common.LongDescription.Common.Text:
The historic Charlick’s Building was originally constructed in 1928, and so named after the Charlick Family who founded the ‘Adelaide Fruit & Produce Exchange Market’ on the south side of Rundle Street back in 1904. This building has been fully upgraded and refurbished over the years (by Maras Group) with two further floors added in 2011, making it a 5-level building.  It truly is a genuine landmark in Adelaide’s East End.

This space is immaculately presented, fully accessible office accommodation.  The tenancy comprises:-

- Reception/waiting;
- Large boardroom;
- Several large & light-filled partitioned offices;
- Two (2) storerooms;
- Server room;
- Kitchenette; and,
- Male, female and access toilet amenities.

This space has the potential to be whatever you want it to be.  Prior to the existing fit-out, it existed as a fully open plan space.  The choice is yours.

The premises presents exceptionally well throughout, has ‘olde world’ high ceilings, loads of natural light and is serviced by ducted reverse cycle air conditioning throughout.

Nestled in between vibrant Rundle Street and Ebenezer Place, directly above retail powerhouse Zimmermann, with Adelaide Institution, the Belgian Beer Café,  towards the rear of the building on Ebenezer Place.  The office is on the doorstep of several well-known eateries, bars and pubs including Felici Espresso Bar, Lemongrass Thai Bistro, Ong Vietnamese Kitchen and Eros Kafe.
